import React from "react";
function Line() {
  return (
    <footer>
      <div className="line"></div>
      <div class="container end-footer">
        <div class="copyright">
          copyright © 2023 - Present • <b>LONGDINO</b>
        </div>
        <a class="Cam" href="https://www.instagram.com/camssitto/">
          Cam Design
        </a>
      </div>
    </footer>
  );
}
export default Line;
